function ItemListContainer() {
    return (
      <>
        <p 
        style={{
          color: 'black',
          fontSize: '50px',
          textAlign: 'center',
          fontWeight : '20px'
          }}>
          Bienvenido a 
          <span
          style={{
            color: 'orange'
          }}
          > STADIUM
          </span>
          </p>
      </>
    );
  }
  
  export default ItemListContainer;
